import axios from "axios";

class ApiRequester {
  public static tryToAuthenticate = async (email: string, password: string) => {
    const endPoint = "http://localhost:3001/";
    try{
      const response = await axios(endPoint , {
        method: 'get',
        params: {
          email: email,
          password: password
        }
      });

      console.log(JSON.parse(response.data));

      return response;
    } catch(error) {
      throw error;
    }
  }
}

export default ApiRequester;
